import { data } from "../../data/data";

import React from 'react'
import Card from "./Card";

const Cards = () => {
  return (
    <div className="grid grid">
        {
            data.map((items)=>{
                return(
                    <Card data={items} key={items.id}/>
                )
            })
        }
    </div>
  )
}

export default Cards
